

class RBNode:
	def __init__(self, key):
		self.key = key
		self.count = 1      # number of duplicates
		
		self.left = None
		self.right = None
		self.parent = None
		
		
class RedBlackTree_set:
	def __init__(self):
		self.nil = None# RBNode(None) # None
		self.root = self.nil
		
	def insert(self, key):
		node = RBNode(key)
		node.left = self.nil#<<<
		node.right = self.nil#<<<
		
		parent = None
		curr = self.root
		
		while curr != self.nil:
			parent = curr
			if key == curr.key:
				curr.count += 1
				return
			elif key < curr.key:
				curr = curr.left
			else:
				curr = curr.right
				
		node.parent = parent
		if parent is None:
			self.root = node
		elif key < parent.key:
			parent.left = node
		else:
			parent.right = node
			
			
	def inorder(self):
		result = []
		self._inorder(self.root, result)
		print(len(result))
		return result
	
	def _inorder(self, node, result):
		if node != self.nil:
			self._inorder(node.left, result)
			result.extend([node.key] * node.count)
			self._inorder(node.right, result)
			
			
def rad1(arr):
	tree = RedBlackTree_set()
	for x in arr:
		tree.insert(x)
	return tree.inorder()

			

